Príbalový leták (PIL) DEPO-MEDROL ® 40 mg/ml Injekčná suspenzia (methylprednisoloni acetas) Držiteľ rozhodnutia o registrácii Pfizer Europe MA EEIG, Sandwich, Kent CT13 9NJ, Veľká Británia ZLOŽENIE LIEKU Každý ml obsahuje : Liečivo : methylprednisoloni acetas (octan metylprednizolónu) 40 mg v 1 ml Pomocné látky : macrogolum 3350 (polyetylénglykol 3350) 28 mg, natrii chloridum (chlorid sodný) 8,7 mg, myristil-g-picolini chloridum (chlorid myristyl-g-picolínu) 0,2 mg, aqua pro iniectione (voda na 
..........
 ). Ak nie je možná perorálna liečba a tento liek je vhodný na liečbu daného stavu, intramuskulárne použitie DEPO-MEDROLu ® 40 mg/ml je indikované v nasledujúcich stavoch: PROTIZÁPALOVÁ LIEČBA Ako adjuvantná liečba pri udržiavacej terapii (analgetikum, kinezioterapia, fyzioterapia, atď.) a na krátkodobé podávanie (pomoc pacientovi prekonať akútny stav alebo exacerbáciu choroby) pri: - psoriatickej artritíde - ankylóznej spondylitíde Pri nasledovných indikáciách sa má uprednostniť podávanie in si
